import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="bg-black text-white p-4 flex justify-between items-center">
      <h1 className="font-bold text-xl">GenVision 2025</h1>
   <div className="flex gap-8 text-lg font-semibold">
   <Link to="/" className="px-2">About</Link>
  <Link to="/Events" className="px-2">Events</Link>
  <Link to="/Participants" className="px-2">Participate</Link>
  <Link to="/Coordinators" className="px-2">Coordinators</Link>
  <Link to="/Guests" className="px-2">Guests</Link>
</div>
    </nav>
  );
}
